function move(event){
    var curX=event.clientX;
    var curY=event.clientY;

    if (mouseIsDown&&(Math.abs(curX-x)>moveWidth)) {
        //code
        var offset=-1*(curX-x);
        curSeqLeftPos=curSeqLeftPos+offset/nucliedWidth;

        var plotEndPos=seqEndPos-(canvasWidth-leftPos)/nucliedWidth+200/nucliedWidth;

        if (curSeqLeftPos<seqBegPos) {
            //code
            curSeqLeftPos=seqBegPos;
        }

        if (curSeqLeftPos>plotEndPos) {


            curSeqLeftPos=plotEndPos;
        }

        plot();

        x=curX;
        y=curY;
    }


}

function mouseWheel(event){
    //alert("what");
    var shiftDown = event.shiftKey;
    var ctrlDown=event.ctrlKey;
    if (ctrlDown) {
        //code
        var delta=event.wheelDelta;

        if (delta<0) {
            //code
            zoomIn();
        }else{
            zoomOut();
        }

    }

    if (shiftDown) {
        //code
        //code
        //var delta = Math.max(-1, Math.min(1, (e.wheelDelta || -e.detail)))
        var delta=event.wheelDelta;
        //var offset=-1*(curX-x);
        curSeqLeftPos=curSeqLeftPos+delta/nucliedWidth;

        var plotEndPos=seqEndPos-(canvasWidth-leftPos)/nucliedWidth+200/nucliedWidth;

        if (curSeqLeftPos<seqBegPos) {
            //code
            curSeqLeftPos=seqBegPos;
        }

        if (curSeqLeftPos>plotEndPos) {


            curSeqLeftPos=plotEndPos;
        }

        plot();

        x=curX;
        y=curY;

    }

}



